```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Define the data pin connected to the 1-Wire bus
#define ONE_WIRE_BUS 4

// Initialize OneWire and DallasTemperature objects
OneWire oneWire(ONE_WIRE_BUS);
DallasTemperature sensors(&oneWire);

void setup() {
  Serial.begin(115200);
  // Start the DallasTemperature library
  sensors.begin();
}

void loop() {
  // Request temperatures from all sensors
  sensors.requestTemperatures();

  // Get the number of sensors found
  int numSensors = sensors.getDeviceCount();

  // Loop through each sensor and print its address and temperature
  for (int i = 0; i < numSensors; i++) {
    // Get the sensor address
    String address = sensors.getAddress(i);

    // Get the temperature in Celsius
    float temperatureC = sensors.getTempCByIndex(i);

    // Print the sensor address and temperature
    Serial.print("Sensor ");
    Serial.print(i);
    Serial.print(": Address = ");
    Serial.println(address);
    Serial.print("Temperature: ");
    Serial.print(temperatureC);
    Serial.println("°C");
  }

  // Delay for a short period
  delay(2000);
}
```

**Explicación del código:**

1. **Librerías:**
   - `OneWire.h`: Librería para comunicarse con el bus 1-Wire.
   - `DallasTemperature.h`: Librería para controlar los sensores Dallas 18B20.

2. **Definición de pines:**
   - `ONE_WIRE_BUS`: Define el pin del ESP32 conectado al bus 1-Wire.

3. **Inicialización:**
   - Se crean objetos `OneWire` y `DallasTemperature` para manejar la comunicación con el bus 1-Wire y los sensores.

4. **Setup:**
   - Se inicializa la comunicación serial a 115200 baudios.
   - Se inicia la biblioteca `DallasTemperature`.

5. **Loop:**
   - Se solicita a todos los sensores que envíen sus temperaturas.
   - Se obtiene el número de sensores encontrados.
   - Se itera sobre cada sensor:
     - Se obtiene la dirección del sensor.
     - Se obtiene la temperatura del sensor en grados Celsius.
     - Se imprime la dirección y la temperatura del sensor en el monitor serial.
   - Se introduce un retraso de 2 segundos para evitar sobrecargar el bus 1-Wire.

**Antes de subir el código al ESP32:**

- Asegúrate de conectar el sensor Dallas 18B20 al pin definido en `ONE_WIRE_BUS`.
- Instala las librerías `OneWire` y `DallasTemperature` en tu IDE de Arduino.

