#include <stdio.h>

void bubbleSort(int arr[], int n) {
  int i, j, temp;
  for (i = 0; i < n - 1; i++) {
    for (j = 0; j < n - i - 1; j++) {
      if (arr[j] > arr[j + 1]) {
        // Swap arr[j] and arr[j+1]
        temp = arr[j];
        arr[j] = arr[j + 1];
        arr[j + 1] = temp;
      }
    }
  }
}

int main() {
  int arr[] = {64, 34, 25, 12, 22, 11, 90};
  int n = sizeof(arr) / sizeof(arr[0]);

  printf("Array antes del ordenamiento: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }

  bubbleSort(arr, n);

  printf("\nArray después del ordenamiento: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }
  printf("\n");

  return 0;
}
```

**Explicación:**

1. **`bubbleSort(int arr[], int n)`:**
   - Esta función toma un arreglo de enteros `arr` y su tamaño `n` como entrada.
   - Utiliza dos bucles anidados:
     - El bucle externo itera desde `i = 0` hasta `n - 1`.
     - El bucle interno itera desde `j = 0` hasta `n - i - 1`.
   - En cada iteración del bucle interno, compara los elementos adyacentes `arr[j]` y `arr[j + 1]`.
   - Si `arr[j]` es mayor que `arr[j + 1]`, los intercambia usando una variable temporal `temp`.
   - Este proceso se repite hasta que el arreglo esté ordenado.

2. **`main()`:**
   - Define un arreglo de ejemplo `arr`.
   - Calcula el tamaño del arreglo `n`.
   - Imprime el arreglo antes del ordenamiento.
   - Llama a la función `bubbleSort()` para ordenar el arreglo.
   - Imprime el arreglo después del ordenamiento.

**Cómo funciona el algoritmo Bubble Sort:**

El algoritmo Bubble Sort funciona comparando elementos adyacentes en el arreglo y intercambiándolos si están en el orden incorrecto. En cada pasada por el arreglo, el elemento más grande "flota" hasta su posición final. El nombre "Bubble Sort" proviene de esta acción de "burbujeo" de los elementos más grandes hacia arriba.

**Complejidad:**

- **Tiempo:** O(n^2) en el peor y promedio de los casos.
- **Espacio:** O(1) (in situ)

